import React, { Component } from "react";
import { Link } from "react-router-dom";

class Landing extends Component {
  render() {
    return (
      <div style={{ height: "75vh", backgroundColor: 'white' }} className="container valign-wrapper">
            <h1 className={"center-align"}> Startseite </h1>
      </div>
    );
  }
}

export default Landing;
